import "./HeaderCart.css";
import CartIcon from "../Carts/CartIcon";
function HeaderCart() {
  return (
    <button className="button">
      <span className="icon">
        <CartIcon/>
      </span>
      <span>Your cart</span>
      <span className="badge">3</span>
    </button>
  );
}
export default HeaderCart;
